package org.example;
import org.json.JSONArray;
import org.json.JSONObject;
import org.json.JSONTokener;

import software.amazon.awssdk.core.sync.RequestBody;
import software.amazon.awssdk.services.s3.model.*;

import java.io.*;
import java.nio.ByteBuffer;
import java.nio.charset.StandardCharsets;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import java.util.Random;

public class Main {
    final static AWS aws = AWS.getInstance();
    public static void main(String[] args) throws IOException {
        String first = "";
        String second = "";
        String third = "";

        int mb = 1024 * 1024;
        // First create a multipart upload and get upload id
        CreateMultipartUploadRequest createMultipartUploadRequest = CreateMultipartUploadRequest.builder()
                .bucket("nitay-aws-test").key("test")
                .build();
        CreateMultipartUploadResponse response = aws.s3.createMultipartUpload(createMultipartUploadRequest);
        String uploadId = response.uploadId();


        UploadPartRequest uploadPartRequest1 = UploadPartRequest.builder().bucket("nitay-aws-test").key("test")
                .uploadId(uploadId)
                .partNumber(3).build();
        String etag3 = aws.s3.uploadPart(uploadPartRequest1, RequestBody.fromString(third)).eTag();
        CompletedPart part3 = CompletedPart.builder().partNumber(3).eTag(etag3).build();



        UploadPartRequest uploadPartRequest2 = UploadPartRequest.builder().bucket("nitay-aws-test").key("test")
                .uploadId(uploadId)
                .partNumber(2).build();
        String etag2 = aws.s3.uploadPart(uploadPartRequest2, RequestBody.fromString(second)).eTag();
        CompletedPart part2 = CompletedPart.builder().partNumber(2).eTag(etag2).build();


        UploadPartRequest uploadPartRequest3 = UploadPartRequest.builder().bucket("nitay-aws-test").key("test")
                .uploadId(uploadId)
                .partNumber(1).build();
        String etag1 = aws.s3.uploadPart(uploadPartRequest3, RequestBody.fromString(first)).eTag();
        CompletedPart part1 = CompletedPart.builder().partNumber(1).eTag(etag1).build();

        CompletedPart [] test= {part1,part2,part3};
        List<CompletedPart> listTest= Arrays.asList(test);


        CompletedMultipartUpload completedMultipartUpload = CompletedMultipartUpload.builder().parts(listTest).build();
        CompleteMultipartUploadRequest completeMultipartUploadRequest =
                CompleteMultipartUploadRequest.builder().bucket("nitay-aws-test").key("test").uploadId(uploadId)
                        .multipartUpload(completedMultipartUpload).build();
        aws.s3.completeMultipartUpload(completeMultipartUploadRequest);
    }



    private static ByteBuffer getRandomByteBuffer(int size) throws IOException {
        byte[] b = new byte[size];
        new Random().nextBytes(b);
        return ByteBuffer.wrap(b);
    }




}


